import React from "react";
import styled from "styled-components";

const Section = styled.section`
    width: 100vw;
    background-color: ${props => props.theme.body};
`;

const Navigation = () => {
    return (
        <Section>
            Navigation
        </Section>
    );
};

export default Navigation;
